Input get_first_input() {
  Input input;
  cin >> input.board_size >> input.wormhole_num >> input.measure_stddev;
  input.wormhole_positions = vector<Position>(input.wormhole_num);
  for (auto &w: input.wormhole_positions) cin >> w.x >> w.y;
  return input;
}

void init(Input& input) {
  input.measure_stddev_idx = 0;
  for (int i = 1; i <= 30; i++) {
    if (input.measure_stddev == i * i) {
      input.measure_stddev_idx = i - 1;
      continue;
    }
  }

  input.wormhole_ids = vector<vector<int>>(input.board_size, vector<int>(input.board_size, -1));
  for (int i = 0; i < input.wormhole_num; i++) {
    int x = input.wormhole_positions[i].x;
    int y = input.wormhole_positions[i].y;
    input.wormhole_ids[x][y] = i;
  }

  input.pre_sample_average = vector<vector<double>>(TEMP_MAX + 1, vector<double>(STDDEV_KIND));
  input.pre_sample_variance = vector<vector<double>>(TEMP_MAX + 1, vector<double>(STDDEV_KIND));
  {
    auto encoded_array = Base64::decode(string(AVERAGE_VARIANCE_B64CODE));
    auto decoded_array = FloatDecoder::decode(encoded_array);
    for (int i = 0; i <= TEMP_MAX; i++) {
      for (int j = 0; j < STDDEV_KIND; j++) {
        int idx = i * STDDEV_KIND + j;
        input.pre_sample_average[i][j] = decoded_array[idx];
      }
    }
    for (int i = 0; i <= TEMP_MAX; i++) {
      for (int j = 0; j < STDDEV_KIND; j++) {
        int idx = ((TEMP_MAX + 1) + i) * STDDEV_KIND + j;
        input.pre_sample_variance[i][j] = decoded_array[idx];
      }
    }
  }
}

