// 計測時の標準偏差が低い時用の解法
// - 各出口セルの温度はできるだけ等間隔になるよう配置・それ以外のセルは温度をいい感じにして配置
//   - 各出口セルの温度差は、標準偏差のパラメータに応じたものとする
//   - 出口を含めた温度をどうするかは焼きなましで決める
// - 各セルの計測は、自身の位置について、出口セルの温度差と標準偏差とに応じた回数だけ行う
// - 計測した温度が低かった順に番号付けして回答する
void solve_low_stddev(const Input& input) {
  struct State {
    const Input& input;
    vector<vector<int>> cell_temps;
    ll placement_score;

    State(const Input& input): input(input), cell_temps(vector<vector<int>>(input.board_size, vector<int>(input.board_size))), placement_score(0) {}

    ll calc_score() {
      ll score = 0;
      for (int i = 0; i < input.board_size; i++) {
        for (int j = 0; j < input.board_size; j++) {
          ll diff_down = abs(this->cell_temps[i][j] - this->cell_temps[(i + 1) % input.board_size][j]);
          ll diff_right = abs(this->cell_temps[i][j] - this->cell_temps[i][(j + 1) % input.board_size]);
          score += diff_down * diff_down + diff_right * diff_right;
        }
      }
      placement_score = score;
      return score;
    }

    void update_score(int x, int y, bool after_update) {
      ll diff_up = abs(this->cell_temps[x][y] - this->cell_temps[(x - 1 + input.board_size) % input.board_size][y]);
      ll diff_down = abs(this->cell_temps[x][y] - this->cell_temps[(x + 1) % input.board_size][y]);
      ll diff_left = abs(this->cell_temps[x][y] - this->cell_temps[x][(y - 1 + input.board_size) % input.board_size]);
      ll diff_right = abs(this->cell_temps[x][y] - this->cell_temps[x][(y + 1) % input.board_size]);
      ll score = diff_up * diff_up + diff_down * diff_down + diff_left * diff_left + diff_right * diff_right;
      this->placement_score += after_update ? score : -score;
    }
  };

  const double temp_delta_factor = min((double) TEMP_MAX / (double) (input.wormhole_num - 1), Hyper_parameter::low_stddev_temp_delta_factor[input.measure_stddev_idx]);
  const double temp_min_d = (double) TEMP_MAX / 2.0 + temp_delta_factor * (0.0 - (double) (input.wormhole_num - 1) / 2.0);
  const int temp_min_i = (int) round(temp_min_d);
  const double temp_max_d = (double) TEMP_MAX / 2.0 + temp_delta_factor * ((double) (input.wormhole_num - 1) - (double) (input.wormhole_num - 1) / 2.0);
  const int temp_max_i = (int) round(temp_max_d);

  State state(input);
  for (int i = 0; i < input.board_size; i++) {
    for (int j = 0; j < input.board_size; j++) {
      state.cell_temps[i][j] = theRandom.nextUIntMod(TEMP_MAX + 1);
    }
  }
  for (int i = 0; i < input.wormhole_num; i++) {
    int x = input.wormhole_positions[i].x;
    int y = input.wormhole_positions[i].y;
    int temp = (int) round((double) TEMP_MAX / 2.0 + temp_delta_factor * ((double) i - (double) (input.wormhole_num - 1) / 2.0));
    state.cell_temps[x][y] = temp;
  }

  cerr << "temp_delta_factor = " << temp_delta_factor << endl;
  cerr << "temp_min_d        = " << temp_min_d << endl;
  cerr << "temp_min_i        = " << temp_min_i << endl;
  cerr << "temp_max_d        = " << temp_max_d << endl;
  cerr << "temp_max_i        = " << temp_max_i << endl;
  
  ll score = state.calc_score();
  ll last_score = score;
  ll best_score = score;

  const double base_temperature = 1e5;
  const double target_temperature = 1e-1;
  // const double decay_rate = 4e-5;
  double temperature = base_temperature;

  const int range_start = 500;
  const int range_end = 10;
  int range = range_start;

  int iter_count = 0;
  double time_start = theTimer.time();
  const double time_limit = 3.800;

  while (theTimer.time() < time_limit) {
    double roll = theRandom.nextDouble();
    if (roll < 0.50) {
      int x = theRandom.nextUIntMod(input.board_size);
      int y = theRandom.nextUIntMod(input.board_size);
      if (input.wormhole_ids[x][y] != -1) continue;
      int d = theRandom.nextUIntMod(range * 2 + 1) - range;

      state.update_score(x, y, false);

      int temp_orig = state.cell_temps[x][y];
      state.cell_temps[x][y] = clamp(state.cell_temps[x][y] + d, TEMP_MIN, TEMP_MAX);

      state.update_score(x, y, true);

      score = state.placement_score;

      #ifdef DEBUG
      if (iter_count % 100000 == 0) cerr << iter_count << " " << score << " " << last_score << " " << best_score << " " << temperature << " " << range << " " << theTimer.time() << endl;
      #endif

      if (score <= last_score) {
        last_score = score;
        if (score < best_score) {
          best_score = score;
        }
      }
      else if (theRandom.nextDouble() < exp(double(last_score - score) / temperature)) { // accept
        last_score = score;
      }
      else { // rollback
        state.update_score(x, y, false);
        state.cell_temps[x][y] = temp_orig;
        state.update_score(x, y, true);
        score = last_score;
      }
    }
    else if (roll < 1.00) {
      int id1 = theRandom.nextUIntMod(input.wormhole_num);
      int id2 = theRandom.nextUIntMod(input.wormhole_num);
      if (id1 == id2) continue;

      auto pos1 = input.wormhole_positions[id1];
      auto pos2 = input.wormhole_positions[id2];

      state.update_score(pos1.x, pos1.y, false);
      state.update_score(pos2.x, pos2.y, false);

      swap(state.cell_temps[pos1.x][pos1.y], state.cell_temps[pos2.x][pos2.y]);

      state.update_score(pos1.x, pos1.y, true);
      state.update_score(pos2.x, pos2.y, true);

      score = state.placement_score;

      #ifdef DEBUG
      if (iter_count % 100000 == 0) cerr << iter_count << " " << score << " " << last_score << " " << best_score << " " << temperature << " " << range << " " << theTimer.time() << endl;
      #endif

      if (score <= last_score) {
        last_score = score;
        if (score < best_score) {
          best_score = score;
        }
      }
      else if (theRandom.nextDouble() < exp(double(last_score - score) / temperature)) { // accept
        last_score = score;
      }
      else { // rollback
        state.update_score(pos1.x, pos1.y, false);
        state.update_score(pos2.x, pos2.y, false);
        swap(state.cell_temps[pos1.x][pos1.y], state.cell_temps[pos2.x][pos2.y]);
        state.update_score(pos1.x, pos1.y, true);
        state.update_score(pos2.x, pos2.y, true);
        score = last_score;
      }
    }

    // temperature *= 1.0 - decay_rate;
    temperature = exp(log(base_temperature) - ((log(base_temperature) - log(target_temperature)) * ((theTimer.time() - time_start) * (1.0 / (time_limit - time_start)))));
    range = (int) exp(log(range_start) - ((log(range_start) - log(range_end)) * ((theTimer.time() - time_start) * (1.0 / (time_limit - time_start)))));
    // range = (int) ((double) range_start * (1.0 - (theTimer.time() - time_start) * (1.0 / (time_limit - time_start))) + (double) range_end * (theTimer.time() - time_start) * (1.0 / (time_limit - time_start)));
    iter_count++;
  }

  cerr << "iter_count   = " << iter_count << endl;
  cerr << "score        = " << score << endl;
  cerr << "best_score   = " << best_score << endl;
  cerr << "temperature  = " << temperature << endl;

  place(state.cell_temps);

  const double required_sigma = Hyper_parameter::low_stddev_required_sigma[input.measure_stddev_idx];
  const double pre_sample_average_delta = abs(input.pre_sample_average[temp_min_i][input.measure_stddev_idx] - input.pre_sample_average[(int) round(temp_min_d + temp_delta_factor)][input.measure_stddev_idx]);
  const double pre_sample_variance_min = input.pre_sample_variance[temp_min_i][input.measure_stddev_idx];

  // 必要な計測回数を求める
  int measure_num = MEASURE_COUNT_MAX / input.wormhole_num;
  for (int i = 1; i <= MEASURE_COUNT_MAX / input.wormhole_num; i++) {
    double average_variance = pre_sample_variance_min / (double) i;
    double average_stddev = sqrt(average_variance);
    double sigma = (pre_sample_average_delta / 2.0) / average_stddev;
    if (sigma >= required_sigma) {
      measure_num = i;
      break;
    }
  }

  cerr << "pre_sample_average_delta = " << pre_sample_average_delta << endl;
  cerr << "pre_sample_variance_min  = " << pre_sample_variance_min << endl;
  cerr << "required_sigma           = " << required_sigma << endl;
  cerr << "measure_num              = " << measure_num << endl;
  cerr << "actual_sigma             = " << (pre_sample_average_delta / 2.0) / sqrt(pre_sample_variance_min / (double) measure_num) << endl;

  vector<Measure_result> measure_results;
  for (int i = 0; i < input.wormhole_num; i++) {
    for (int j = 0; j < measure_num; j++) {
      auto res = measure(i, Position(0, 0));
      measure_results.push_back(res);
    }
  }

  vector<pair<int, int>> measured_temp_sum(input.wormhole_num); // id, temp_sum
  for (int i = 0; i < input.wormhole_num; i++) {
    measured_temp_sum[i].first = i;
  }
  for (auto &res: measure_results) {
    measured_temp_sum[res.id].second += res.temp;
  }

  sort(measured_temp_sum.begin(), measured_temp_sum.end(), [&](auto &a, auto &b){return a.second < b.second;});

  vector<int> sorted_wormhole_ids(input.wormhole_num);
  for (int i = 0; i < input.wormhole_num; i++) {
    sorted_wormhole_ids[i] = i;
  }
  sort(sorted_wormhole_ids.begin(), sorted_wormhole_ids.end(), [&state, &input](auto &a, auto &b){
    auto pos_a = input.wormhole_positions[a];
    auto pos_b = input.wormhole_positions[b];
    return state.cell_temps[pos_a.x][pos_a.y] < state.cell_temps[pos_b.x][pos_b.y];
  });

  vector<int> ans(input.wormhole_num);
  for (int i = 0; i < input.wormhole_num; i++) {
    auto id = measured_temp_sum[i].first;
    ans[id] = sorted_wormhole_ids[i];
  }

  answer(ans);
}

// ある2つの標準偏差が同じで平均が異なる正規分布(low, high)について、
// (lowからある個数だけサンプリングしたときの最大値が閾値を超える確率) == (highからある個数だけサンプリングしたときの最小値が閾値未満になる確率)になる閾値と、そのときの確率を求める
pair<double, double> calculate_cross_probabilty_threshold(double low_average, int low_sample_num, double high_average, int high_sample_num, double stddev) {
  double ng = low_average;
  double ok = high_average;
  while (abs(ng - ok) > 1e-3) {
    double mid = (ng + ok) / 2.0;

    double low_cross_probability_per_sample = 1.0 - 0.5 * (1.0 + erf((mid - low_average) / (sqrt(2.0) * stddev)));
    double low_cross_probability = 1.0 - pow(1.0 - low_cross_probability_per_sample, low_sample_num);

    double high_cross_probability_per_sample = 0.5 * (1.0 + erf((mid - high_average) / (sqrt(2.0) * stddev)));
    double high_cross_probability = 1.0 - pow(1.0 - high_cross_probability_per_sample, high_sample_num);

    if (low_cross_probability < high_cross_probability)
      ok = mid;
    else
      ng = mid;
  }
  
  double cross_probability_per_sample = 1.0 - 0.5 * (1.0 + erf((ok - low_average) / (sqrt(2.0) * stddev)));
  double cross_probability = 1.0 - pow(1.0 - cross_probability_per_sample, low_sample_num);
  return make_pair(ok, cross_probability);
}

// 中程度の標準偏差の場合の解法
// - 基準点を適当に決める。その点だけ温度を高くし、それ以外の点は温度を低く設定する。
// - 基準点からの距離が近い出口セルから順に、それがどのワームホールに対応するかを調べる。
//   - 最も測定温度が高かったものを答えとする。
// - 全部の出口セルについて調べ終わったら回答を出力する。
void solve_mid_stddev_v1(const Input& input) {
  const double required_probability = 1e-2;
  const int measure_num = 1;

  // 基準点を決める
  Position base_pos;
  {
    int best_score = 2e9;
    for (int i = 0; i < input.board_size; i++) {
      for (int j = 0; j < input.board_size; j++) {
        int score = 0;
        vector<int> dists;
        for (int k = 0; k < input.wormhole_num; k++) {
          auto wormhole_pos = input.wormhole_positions[k];
          auto dist = min(abs(wormhole_pos.x - i), abs(input.board_size + wormhole_pos.x - i)) + min(abs(wormhole_pos.y - j), abs(input.board_size + wormhole_pos.y - j));
          dists.push_back(dist);
        }
        sort(dists.rbegin(), dists.rend());
        for (int k = 0; k < input.wormhole_num; k++) {
          score += dists[k] * k;
        }
        if (score < best_score) {
          base_pos = Position(i, j);
          best_score = score;
        }
      }
    }
  }

  // 温度を決める
  int min_temp = 0;
  for (int i = 0; i <= TEMP_MAX / 2; i++) {
    double cross_probability;
    tie(ignore, cross_probability) = calculate_cross_probabilty_threshold(i, input.wormhole_num - 1, TEMP_MAX - i, 1, input.measure_stddev);
    if (cross_probability < required_probability) min_temp = i;
    else break;
  }
  int max_temp = TEMP_MAX - min_temp;
  double cross_probability;
  tie(ignore, cross_probability) = calculate_cross_probabilty_threshold(min_temp, input.wormhole_num - 1, max_temp, 1, input.measure_stddev);

  cerr << "measure_num          = " << measure_num << endl;
  cerr << "min_temp             = " << min_temp << endl;
  cerr << "max_temp             = " << max_temp << endl;
  cerr << "required_probability = " << required_probability << endl;
  cerr << "cross_probability    = " << cross_probability << endl;

  // 温度配置の作成
  vector<vector<int>> cell_temps(input.board_size, vector<int>(input.board_size, min_temp));
  cell_temps[base_pos.x][base_pos.y] = TEMP_MAX - min_temp;

  place(cell_temps);

  // 出口セルを近い順に並べる
  vector<int> wormhole_measure_order(input.wormhole_num);
  for (int i = 0; i < input.wormhole_num; i++) {
    wormhole_measure_order[i] = i;
  }
  sort(wormhole_measure_order.begin(), wormhole_measure_order.end(), [&input, &base_pos](auto &a, auto &b){
    const auto wormhole_pos_a = input.wormhole_positions[a];
    const auto wormhole_pos_b = input.wormhole_positions[b];
    const auto dist_a = min(abs(wormhole_pos_a.x - base_pos.x), abs(input.board_size + wormhole_pos_a.x - base_pos.x)) + min(abs(wormhole_pos_a.y - base_pos.y), abs(input.board_size + wormhole_pos_a.y - base_pos.y));
    const auto dist_b = min(abs(wormhole_pos_b.x - base_pos.x), abs(input.board_size + wormhole_pos_b.x - base_pos.x)) + min(abs(wormhole_pos_b.y - base_pos.y), abs(input.board_size + wormhole_pos_b.y - base_pos.y));
    return dist_a < dist_b;
  });

  // 温度を測定して解を求める
  vector<int> ans(input.wormhole_num);
  vector<bool> ans_determined(input.wormhole_num, false);
  for (int i = 0; i < input.wormhole_num; i++) {
    int delta_x, delta_y;
    {
      auto wormhole_pos = input.wormhole_positions[wormhole_measure_order[i]];

      int dist_x_warp_left = abs(input.board_size + wormhole_pos.x - base_pos.x);
      int dist_x_no_warp = abs(wormhole_pos.x - base_pos.x);
      int dist_x_warp_right = abs(input.board_size + base_pos.x - wormhole_pos.x);
      if (dist_x_warp_left < dist_x_no_warp && dist_x_warp_left < dist_x_warp_right) delta_x = -abs(input.board_size + wormhole_pos.x - base_pos.x);
      else if (dist_x_no_warp < dist_x_warp_right) delta_x = base_pos.x - wormhole_pos.x;
      else delta_x = abs(input.board_size + base_pos.x - wormhole_pos.x);

      int dist_y_warp_up = abs(input.board_size + wormhole_pos.y - base_pos.y);
      int dist_y_no_warp = abs(wormhole_pos.y - base_pos.y);
      int dist_y_warp_down = abs(input.board_size + base_pos.y - wormhole_pos.y);
      if (dist_y_warp_up < dist_y_no_warp && dist_y_warp_up < dist_y_warp_down) delta_y = -abs(input.board_size + wormhole_pos.y - base_pos.y);
      else if (dist_y_no_warp < dist_y_warp_down) delta_y = base_pos.y - wormhole_pos.y;
      else delta_y = abs(input.board_size + base_pos.y - wormhole_pos.y);
    }

    vector<Measure_result> measure_results;
    for (int j = 0; j < input.wormhole_num; j++) {
      if (ans_determined[j]) continue;
      for (int k = 0; k < measure_num; k++) {
        auto res = measure(j, Position(delta_x, delta_y));
        measure_results.push_back(res);
      }
    }

    vector<double> measured_temp_average(input.wormhole_num);
    for (auto &res: measure_results) {
      measured_temp_average[res.id] += res.temp;
    }
    for (int j = 0; j < input.wormhole_num; j++) {
      measured_temp_average[j] /= measure_num;
    }

    double highest_average_temp = -1e308;
    int highest_average_temp_idx = 0;
    for (int j = 0; j < input.wormhole_num; j++) {
      if (ans_determined[j]) continue;
      if (measured_temp_average[j] > highest_average_temp) {
        highest_average_temp = measured_temp_average[j];
        highest_average_temp_idx = j;
      }
    }

    ans[highest_average_temp_idx] = wormhole_measure_order[i];
    ans_determined[highest_average_temp_idx] = true;
  }

  answer(ans);
}

// 中程度の標準偏差の場合の解法(改)
// - 基準点を適当に決める。その点だけ温度を高くし、それ以外の点は基準点から離れるほど温度を低く設定する。
// - 基準点からの距離が近い出口セルから順に、それがどのワームホールに対応するかを調べる。
//   - 事前に出口セル自身の場所で測定をしておき、測定温度が高かった順に測定を行うものとする。
//   - 十分高い測定温度が出たら、それを答えとする。
//   - そのような測定温度がひとつも出なかった場合、測定温度が最も高かったものを答えとする。
// - 全部の出口セルについて調べ終わったら回答を出力する。
void solve_mid_stddev_v2(const Input& input) {
  const double required_probability = 1e-2;
  const double non_base_temp_factor = 0.5;
  const int measure_num = 1;

  // 基準点を決める
  Position base_pos;
  {
    int best_score = 2e9;
    for (int i = 0; i < input.board_size; i++) {
      for (int j = 0; j < input.board_size; j++) {
        int score = 0;
        vector<int> dists;
        for (int k = 0; k < input.wormhole_num; k++) {
          auto wormhole_pos = input.wormhole_positions[k];
          auto dist = min(abs(wormhole_pos.x - i), abs(input.board_size + wormhole_pos.x - i)) + min(abs(wormhole_pos.y - j), abs(input.board_size + wormhole_pos.y - j));
          dists.push_back(dist);
        }
        sort(dists.rbegin(), dists.rend());
        for (int k = 0; k < input.wormhole_num; k++) {
          score += dists[k] * k;
        }
        if (score < best_score) {
          base_pos = Position(i, j);
          best_score = score;
        }
      }
    }
  }

  // 温度を決める
  int min_temp = 0;
  for (int i = 0; i <= TEMP_MAX / 2; i++) {
    double cross_probability;
    tie(ignore, cross_probability) = calculate_cross_probabilty_threshold(i, input.wormhole_num - 1, TEMP_MAX - i, 1, input.measure_stddev);
    if (cross_probability < required_probability) min_temp = i;
    else break;
  }
  int max_temp = TEMP_MAX - min_temp;
  double cross_threshold, cross_probability;
  tie(cross_threshold, cross_probability) = calculate_cross_probabilty_threshold(min_temp, input.wormhole_num - 1, max_temp, 1, input.measure_stddev);

  cerr << "measure_num          = " << measure_num << endl;
  cerr << "min_temp             = " << min_temp << endl;
  cerr << "max_temp             = " << max_temp << endl;
  cerr << "required_probability = " << required_probability << endl;
  cerr << "cross_probability    = " << cross_probability << endl;
  cerr << "cross_threshold      = " << cross_threshold << endl;

  // 基準点からの距離の作成
  vector<vector<int>> distance_from_base_pos(input.board_size, vector<int>(input.board_size, 999999999));
  {
    const vector<int> dx = {-1,  0,  1,  0};
    const vector<int> dy = { 0,  1,  0, -1};
    queue<pair<int, Position>> que; // dist, pos
    que.emplace(0, base_pos);
    while (!que.empty()) {
      auto [dist, pos] = que.front();
      que.pop();
      if (dist >= distance_from_base_pos[pos.x][pos.y]) continue;
      distance_from_base_pos[pos.x][pos.y] = dist;
      for (int d = 0; d < 4; d++) {
        if (distance_from_base_pos[(input.board_size + pos.x + dx[d]) % input.board_size][(input.board_size + pos.y + dy[d]) % input.board_size] > dist + 1) {
          que.emplace(dist + 1, Position((input.board_size + pos.x + dx[d]) % input.board_size, (input.board_size + pos.y + dy[d]) % input.board_size));
        }
      }
    }
  }

  // 温度配置の作成
  // 基準点から遠いほど温度を下げる
  vector<vector<int>> cell_temps(input.board_size, vector<int>(input.board_size, min_temp));
  for (int i = 0; i < input.board_size; i++) {
    for (int j = 0; j < input.board_size; j++) {
      if (Position(i, j) == base_pos) {
        cell_temps[i][j] = max_temp;
      }
      else {
        cell_temps[i][j] = (int) round((double) min_temp * (1.0 - ((double) (distance_from_base_pos[i][j] - 1) / (double) (input.board_size & ~(1))) * non_base_temp_factor));
      }
    }
  }

  place(cell_temps);

  // 出口セルを近い順に並べる(特定する出口セルの順序を決める)
  vector<int> exit_cell_determine_order(input.wormhole_num);
  for (int i = 0; i < input.wormhole_num; i++) {
    exit_cell_determine_order[i] = i;
  }
  sort(exit_cell_determine_order.begin(), exit_cell_determine_order.end(), [&input, &base_pos](auto &a, auto &b){
    const auto wormhole_pos_a = input.wormhole_positions[a];
    const auto wormhole_pos_b = input.wormhole_positions[b];
    const auto dist_a = min(abs(wormhole_pos_a.x - base_pos.x), abs(input.board_size + wormhole_pos_a.x - base_pos.x)) + min(abs(wormhole_pos_a.y - base_pos.y), abs(input.board_size + wormhole_pos_a.y - base_pos.y));
    const auto dist_b = min(abs(wormhole_pos_b.x - base_pos.x), abs(input.board_size + wormhole_pos_b.x - base_pos.x)) + min(abs(wormhole_pos_b.y - base_pos.y), abs(input.board_size + wormhole_pos_b.y - base_pos.y));
    return dist_a < dist_b;
  });

  // 出口セルの場所の温度を調べる(ワームホールを調べる順序を決める)
  vector<int> wormhole_measure_order(input.wormhole_num);
  if (min_temp > 0) {
    vector<Measure_result> measure_results;
    for (int i = 0; i < input.wormhole_num; i++) {
      auto res = measure(i, Position(0, 0));
      measure_results.push_back(res);
    }
    sort(measure_results.rbegin(), measure_results.rend(), [](auto &a, auto &b){return a.temp < b.temp;});
    for (int i = 0; i < input.wormhole_num; i++) {
      wormhole_measure_order[i] = measure_results[i].id;
    }
  }
  else {
    // 基準点以外のセルの温度が0なら判別不能なので、適当な順序でよい
    for (int i = 0; i < input.wormhole_num; i++) {
      wormhole_measure_order[i] = i;
    }
  }

  // 温度を測定して解を求める
  vector<int> ans(input.wormhole_num);
  vector<bool> ans_determined(input.wormhole_num, false);
  for (int i = 0; i < input.wormhole_num; i++) {
    int delta_x, delta_y;
    {
      auto wormhole_pos = input.wormhole_positions[exit_cell_determine_order[i]];

      int dist_x_warp_left = abs(input.board_size + wormhole_pos.x - base_pos.x);
      int dist_x_no_warp = abs(wormhole_pos.x - base_pos.x);
      int dist_x_warp_right = abs(input.board_size + base_pos.x - wormhole_pos.x);
      if (dist_x_warp_left < dist_x_no_warp && dist_x_warp_left < dist_x_warp_right) delta_x = -abs(input.board_size + wormhole_pos.x - base_pos.x);
      else if (dist_x_no_warp < dist_x_warp_right) delta_x = base_pos.x - wormhole_pos.x;
      else delta_x = abs(input.board_size + base_pos.x - wormhole_pos.x);

      int dist_y_warp_up = abs(input.board_size + wormhole_pos.y - base_pos.y);
      int dist_y_no_warp = abs(wormhole_pos.y - base_pos.y);
      int dist_y_warp_down = abs(input.board_size + base_pos.y - wormhole_pos.y);
      if (dist_y_warp_up < dist_y_no_warp && dist_y_warp_up < dist_y_warp_down) delta_y = -abs(input.board_size + wormhole_pos.y - base_pos.y);
      else if (dist_y_no_warp < dist_y_warp_down) delta_y = base_pos.y - wormhole_pos.y;
      else delta_y = abs(input.board_size + base_pos.y - wormhole_pos.y);
    }

    int best_wormhole_id = 0;
    double best_wormhole_average_temp = -1e308;
    for (int j = 0; j < input.wormhole_num; j++) {
      if (ans_determined[wormhole_measure_order[j]]) continue;
      double measured_temp_average = 0.0;
      for (int k = 0; k < measure_num; k++) {
        auto res = measure(wormhole_measure_order[j], Position(delta_x, delta_y));
        measured_temp_average += res.temp;
      }
      measured_temp_average /= measure_num;
      if (measured_temp_average > best_wormhole_average_temp) {
        best_wormhole_id = wormhole_measure_order[j];
        best_wormhole_average_temp = measured_temp_average;
        // 当たりっぽい温度なら即決定する
        if (measured_temp_average > cross_threshold) {
          break;
        }
      }
    }

    ans[best_wormhole_id] = exit_cell_determine_order[i];
    ans_determined[best_wormhole_id] = true;
  }

  answer(ans);
}

// 標準偏差が高い時用の解法
// - 各出口セルからの測定点を何個か決め、測定点に0か1000の温度を割り当てる。測定点以外のセルの温度は適当に決める。
//   - 測定点の温度は、出口セルごとにできるだけ異なるようにする。温度の組み合わせが全く同じものがあったらペナルティ。
// - 各ワームホールについて測定点の温度を測定し、測定結果が最も近い出口セルを答えとする。
void solve_high_stddev(const Input& input) {
  struct State {
    const Input& input;

    vector<vector<int>> cell_temps;
    ll placement_score;

    const ll code_penalty_factor = 100000000;
    unordered_map<int, int> code_count;
    vector<vector<vector<int>>> affected_exit_cells_on_change;
    ll code_score;

    // 測定点
    const vector<Position> measure_positions = {
      Position(-7, -7),
      Position(-7,  0),
      Position(-6,  6),
      Position( 0,  6),
      Position( 5,  5),
      Position( 5,  0),
      Position( 4, -4),
      Position( 0, -4)
    };

    State(const Input& input) :
      input(input)
    {
      this->cell_temps = vector<vector<int>>(input.board_size, vector<int>(input.board_size));
      this->placement_score = 0;
      
      this->affected_exit_cells_on_change = vector<vector<vector<int>>>(input.board_size, vector<vector<int>>(input.board_size));
      for (int i = 0; i < input.wormhole_num; i++) {
        for (auto &pos: input.wormhole_positions) {
          for (auto &offset: measure_positions) {
            auto absolute_measure_pos = pos.move_by(offset, input.board_size);
            this->affected_exit_cells_on_change[absolute_measure_pos.x][absolute_measure_pos.y].push_back(i);
          }
        }
      }
      this->code_score = 0;
    }

    ll calc_score() {
      placement_score = 0;
      for (int i = 0; i < input.board_size; i++) {
        for (int j = 0; j < input.board_size; j++) {
          ll diff_down = abs(this->cell_temps[i][j] - this->cell_temps[(i + 1) % input.board_size][j]);
          ll diff_right = abs(this->cell_temps[i][j] - this->cell_temps[i][(j + 1) % input.board_size]);
          placement_score += diff_down * diff_down + diff_right * diff_right;
        }
      }

      code_score = 0;
      code_count.clear();
      for (int i = 0; i < input.wormhole_num; i++) {
        auto code = get_code(i);
        code_count[code]++;
        if (code_count[code] >= 2) code_score += code_penalty_factor;
      }

      return placement_score + code_score;
    }

    int get_code(int id) {
      int code = 0;
      auto pos = input.wormhole_positions[id];
      for (int i = 0; i < (int) measure_positions.size(); i++) {
        auto offset = measure_positions[i];
        auto absolute_measure_pos = pos.move_by(offset, input.board_size);
        auto cell_temp = cell_temps[absolute_measure_pos.x][absolute_measure_pos.y];
        if (cell_temp > TEMP_MAX / 2) code |= 1 << i;
      }
      return code;
    }

    void update_score(int x, int y, bool after_update) {
      ll diff_up = abs(this->cell_temps[x][y] - this->cell_temps[(x - 1 + input.board_size) % input.board_size][y]);
      ll diff_down = abs(this->cell_temps[x][y] - this->cell_temps[(x + 1) % input.board_size][y]);
      ll diff_left = abs(this->cell_temps[x][y] - this->cell_temps[x][(y - 1 + input.board_size) % input.board_size]);
      ll diff_right = abs(this->cell_temps[x][y] - this->cell_temps[x][(y + 1) % input.board_size]);
      ll score = diff_up * diff_up + diff_down * diff_down + diff_left * diff_left + diff_right * diff_right;
      this->placement_score += after_update ? score : -score;

      for (auto &id: affected_exit_cells_on_change[x][y]) {
        auto code = get_code(id);
        if (after_update) {
          code_count[code]++;
          if (code_count[code] >= 2) code_score += code_penalty_factor;
        }
        else {
          if (code_count[code] >= 2) code_score -= code_penalty_factor;
          code_count[code]--;
        }
      }
    }
  };

  State state(input);
  for (int i = 0; i < input.board_size; i++) {
    for (int j = 0; j < input.board_size; j++) {
      if (state.affected_exit_cells_on_change[i][j].empty()) {
        state.cell_temps[i][j] = theRandom.nextUIntMod(TEMP_MAX + 1);
      }
      else {
        // 測定点の温度は0か1000だけにする
        state.cell_temps[i][j] = theRandom.nextUIntMod(2) * TEMP_MAX;
      }
    }
  }
  
  ll score = state.calc_score();
  ll last_score = score;
  ll best_score = score;

  const double base_temperature = 1e7;
  const double target_temperature = 1e-1;
  // const double decay_rate = 4e-5;
  double temperature = base_temperature;

  const int range_start = 1000;
  const int range_end = 200;
  int range = range_start;

  int iter_count = 0;
  double time_start = theTimer.time();
  const double time_limit = 3.800;

  while (theTimer.time() < time_limit) {
    double roll = theRandom.nextDouble();
    if (roll < 0.50) {
      int x = theRandom.nextUIntMod(input.board_size);
      int y = theRandom.nextUIntMod(input.board_size);
      int d;
      if (state.affected_exit_cells_on_change[x][y].empty()) {
        d = theRandom.nextUIntMod(range * 2 + 1) - range;
      }
      else {
        d = theRandom.nextUIntMod(2) * TEMP_MAX * 2 - TEMP_MAX;
      }

      state.update_score(x, y, false);

      int temp_orig = state.cell_temps[x][y];
      state.cell_temps[x][y] = clamp(state.cell_temps[x][y] + d, TEMP_MIN, TEMP_MAX);

      state.update_score(x, y, true);

      score = state.placement_score + state.code_score;

      #ifdef DEBUG
      if (iter_count % 10000 == 0) cerr << iter_count << " " << score << " " << last_score << " " << best_score << " " << temperature << " " << range << " " << theTimer.time() << endl;
      #endif

      if (score <= last_score) {
        last_score = score;
        if (score < best_score) {
          best_score = score;
        }
      }
      else if (theRandom.nextDouble() < exp(double(last_score - score) / temperature)) { // accept
        last_score = score;
      }
      else { // rollback
        state.update_score(x, y, false);
        state.cell_temps[x][y] = temp_orig;
        state.update_score(x, y, true);
        score = last_score;
      }
    }
    else if (roll < 1.00) {
      int x1 = theRandom.nextUIntMod(input.board_size);
      int y1 = theRandom.nextUIntMod(input.board_size);
      if (state.affected_exit_cells_on_change[x1][y1].empty()) continue;
      int x2 = theRandom.nextUIntMod(input.board_size);
      int y2 = theRandom.nextUIntMod(input.board_size);
      if (state.affected_exit_cells_on_change[x2][y2].empty()) continue;
      if (x1 == x2 && y1 == y2) continue;

      state.update_score(x1, y1, false);
      state.update_score(x2, y2, false);

      swap(state.cell_temps[x1][y1], state.cell_temps[x2][y2]);

      state.update_score(x1, y1, true);
      state.update_score(x2, y2, true);

      score = state.placement_score + state.code_score;

      #ifdef DEBUG
      if (iter_count % 10000 == 0) cerr << iter_count << " " << score << " " << last_score << " " << best_score << " " << temperature << " " << range << " " << theTimer.time() << endl;
      #endif

      if (score <= last_score) {
        last_score = score;
        if (score < best_score) {
          best_score = score;
        }
      }
      else if (theRandom.nextDouble() < exp(double(last_score - score) / temperature)) { // accept
        last_score = score;
      }
      else { // rollback
        state.update_score(x1, y1, false);
        state.update_score(x2, y2, false);
        swap(state.cell_temps[x1][y1], state.cell_temps[x2][y2]);
        state.update_score(x1, y1, true);
        state.update_score(x2, y2, true);
        score = last_score;
      }
    }

    // temperature *= 1.0 - decay_rate;
    temperature = exp(log(base_temperature) - ((log(base_temperature) - log(target_temperature)) * ((theTimer.time() - time_start) * (1.0 / (time_limit - time_start)))));
    range = (int) exp(log(range_start) - ((log(range_start) - log(range_end)) * ((theTimer.time() - time_start) * (1.0 / (time_limit - time_start)))));
    // range = (int) ((double) range_start * (1.0 - (theTimer.time() - time_start) * (1.0 / (time_limit - time_start))) + (double) range_end * (theTimer.time() - time_start) * (1.0 / (time_limit - time_start)));
    iter_count++;
  }

  cerr << "iter_count      = " << iter_count << endl;
  cerr << "score           = " << score << endl;
  cerr << "placement_score = " << state.placement_score << endl;
  cerr << "code_score      = " << state.code_score << endl;
  cerr << "best_score      = " << best_score << endl;
  cerr << "temperature     = " << temperature << endl;

  place(state.cell_temps);

  const double required_sigma = 4.0;
  const double pre_sample_average_min = input.pre_sample_average[TEMP_MIN][input.measure_stddev_idx];
  const double pre_sample_variance_min = input.pre_sample_variance[TEMP_MIN][input.measure_stddev_idx];

  // 必要な計測回数を求める
  int measure_num = MEASURE_COUNT_MAX / (input.wormhole_num * (int) state.measure_positions.size());
  for (int i = 1; i <= MEASURE_COUNT_MAX / (input.wormhole_num * (int) state.measure_positions.size()); i++) {
    double average_variance = pre_sample_variance_min / (double) i;
    double average_stddev = sqrt(average_variance);
    double sigma = ((double) TEMP_MAX / 2.0 - pre_sample_average_min) / average_stddev;
    if (sigma >= required_sigma) {
      measure_num = i;
      break;
    }
  }

  cerr << "pre_sample_average_min  = " << pre_sample_average_min << endl;
  cerr << "pre_sample_variance_min = " << pre_sample_variance_min << endl;
  cerr << "required_sigma          = " << required_sigma << endl;
  cerr << "measure_num             = " << measure_num << endl;
  cerr << "actual_sigma            = " << ((double) TEMP_MAX / 2.0 - pre_sample_average_min) / sqrt(pre_sample_variance_min / (double) measure_num) << endl;

  vector<int> ans(input.wormhole_num);
  for (int i = 0; i < input.wormhole_num; i++) {
    vector<double> measure_averages(state.measure_positions.size());
    for (int j = 0; j < (int) state.measure_positions.size(); j++) {
      auto pos = state.measure_positions[j];
      for (int k = 0; k < measure_num; k++) {
        auto res = measure(i, pos);
        measure_averages[j] += res.temp;
      }
      measure_averages[j] /= (double) measure_num;
    }

    // 温度差の総和が最も小さい出口セルを答えとする
    int best_exit_cell_id = 0;
    double best_temp_diff = 1e308;
    for (int k = 0; k < input.wormhole_num; k++) {
      double temp_diff = 0.0;
      auto pos = input.wormhole_positions[k];
      for (int j = 0; j < (int) state.measure_positions.size(); j++) {
        auto offset = state.measure_positions[j];
        auto absolute_measure_pos = pos.move_by(offset, input.board_size);
        auto cell_temp = state.cell_temps[absolute_measure_pos.x][absolute_measure_pos.y];
        temp_diff += abs((double) cell_temp - measure_averages[j]);
      }
      if (temp_diff < best_temp_diff) {
        best_exit_cell_id = k;
        best_temp_diff = temp_diff;
      }
    }

    ans[i] = best_exit_cell_id;
  }

  answer(ans);
}

void solve(const Input& input) {
       if (input.measure_stddev_idx < 5)  solve_low_stddev(input);
  else if (input.measure_stddev_idx < 13) solve_mid_stddev_v2(input);
  else if (input.measure_stddev_idx < 15) solve_mid_stddev_v1(input);
  else                                    solve_high_stddev(input);
}

int main(int argc, char *argv[]) {
  cin.tie(0);
  ios::sync_with_stdio(false);

  auto input = get_first_input();

  init(input);
  solve(input);

  return 0;
}
